import React from "react";
import {
  Nav,
  NavItem,
  Dropdown,
  DropdownItem,
  DropdownToggle,
  DropdownMenu,
  NavLink
} from "reactstrap";
import "./Activity.css";

class Activity extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      dropdownOpen: false
    };
  }
  toggle() {
    this.setState({
      dropdownOpen: !this.state.dropdownOpen
    });
  }
  render() {
    return (
      <div>
        <Nav tabs className="navBar">
          <NavItem>
            <NavLink href="#" active>
              Activities
            </NavLink>
          </NavItem>

          <NavItem>
            <NavLink href="#">Animals</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#">Animations</NavLink>
          </NavItem>
          <NavItem>
            <NavLink disabled href="#">
              Disabled Link
            </NavLink>
          </NavItem>
        </Nav>
      </div>
    );
  }
}

export default Activity;
